絶大な信頼性とダイレクトなペダルタッチを誇るブレーキラインの傑作！一体成形によるホースエンドはフルード漏れを完全に防ぎ、材質にはステンレスSUS303材を使用。 <br><br>ホースは高品質なテフロン＆ステンレスメッシュを採用することでホースの膨張を無くし、ダイレクトでリニアなペダルタッチを実現。ABSの作動性を向上させます。<br><br>※ターボのみ適合 <br><br>対応車種 ： JZA80 スープラ <br><br>　車検対応品<br><br>ブレーキ/ブレーキホース<tr><td colspan="2">
