あなたもこれで憧れのビックキャリパーに！　ウェーバースポーツのキャリパーカバーは車種別に設計されているので、フィッティング抜群です。取り付けは金属のステイやホースバンドにスプリングを引っ掛けるだけでOKです。タイヤさえ外せればカンタンにD.I.Yが可能です！　他社との違いは専用タイプなので、しっかり固定が出来、奥行きまで作り込みをしているので、ホイールを取り付けした後、純正キャリパーが見えずボリューム感があります。材質■FRP製・厚さは約3mm(本物銅パイプ、ブリーダプラグ、キャップを使用）。　<br><br>※オプションでロゴマークやロゴのカラーも変更可能です。ロゴを転写してから、耐熱クリアコーティングで仕上げておりますので、変更希望の場合には必ずご注文時にお知らせください。※車種情報の記載が必須の商品です。オーダーの際は車種・年式・型式・グレード・ターボ/NAの有無を必ず記載して下さい。※受注生産品となります為、納期は2?3週間前後になります。<br><br>※取り付けにはホイールの裏側とキャリパーの間に、約2cm～3cmの隙間が最低限必要になります。干渉する際には別途3mm～5mm以上のホイールスペーサーが必要となります。※商品画像はイメージです。車種専用設計ですので、実物とは形状が異なります。※受注生産品につき代引・返品交換対応不可となります。お間違いのないようにご注文ください。<br><br><br>対応車種：2008年5月～ GWS204 クラウン ハイブリッド<br><br>ブレーキ | ブレーキその他<br>トヨタ | クラウン | GRS/GWS200系<tr><td colspan="2">
